import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';

const book = (props) => {
  return (
    <div>
      <Card>
        <CardImg top width="100%" src="https://res.cloudinary.com/vntrieu/image/upload/v1602642010/book/9781791122522_kjqgei.gif" alt="Card image cap" />
        <CardBody>
          <CardTitle>Card title</CardTitle>
          <CardSubtitle>Card subtitle</CardSubtitle>
          <CardText>50$</CardText>
          <Button>Add to cart</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default book;
